const Card = (props) => {
    return (
        <div className="pb-3 col-4 text-center px-0">
            <div className="rounded-card shadow-lg  w-75" style={{overflow: "hidden"}}>
                <div className="card-img">
                    <img src={props.cardImage} className="w-100" style={{height: "350px"}}/>
                </div>
                <div className="card-custom-body px-4 py-4">
                    <h3 className="title text-center mb-3">اسلام سعيد</h3>
                    <h6 className="subtitle text-muted text-center card-subtitle">مطور ويب واندرويد</h6>
                </div>
                <hr/>
                <div className="card-custom-footer">

                </div>
            </div>
        </div>
    )
};


export default Card;
